import img from './image.jpeg';
import './App.css';

function Image() {
  return (
    <div>
        <img src={img} alt="monkey" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

    </div>
  );
}

export default App;
